import React from 'react';
import { Box, Container, Toolbar, Typography } from '@mui/material';

const Trends = () => {
  return (
    <>
      <Toolbar></Toolbar>
      <Container sx={{ background: 'black', height: '100vh' }}>
        <Box>
          <Typography>Trending </Typography>
        </Box>
      </Container>
    </>
  );
};

export default Trends;
